-- Dumping structure for procedure dbmymodbus.checkOpr
DROP PROCEDURE IF EXISTS `checkOpr`;
DELIMITER //
CREATE PROCEDURE `checkOpr`(
	IN `in_sel` INT,
	IN `in_svcid` VARCHAR(50)
)
BEGIN

IF(SELECT COUNT(*) FROM _operations WHERE state>0)>0 THEN
  
  /*UPDATE _operations  SET state=state+1 WHERE state>0 ;*/

  SELECT o.* FROM _operations o 
  INNER JOIN devices d ON d.id=o.object AND d.svcid=in_svcid AND (d.state>0 OR o.action='device_del')
  WHERE UNIX_TIMESTAMP(o.time) < UNIX_TIMESTAMP()-20 AND o.state>0;
  
  DELETE o.*  FROM _operations o 
  INNER JOIN devices d ON d.id=o.object AND d.svcid=in_svcid AND (d.state>0 OR o.action='device_del')
  WHERE  UNIX_TIMESTAMP(o.time) < UNIX_TIMESTAMP()-20 AND o.state>0;
  
END IF;
  /*6 zaman beklemesi sonra  işleme alınır. 
  device eklendikten sonra eklenen tagların uptadeti devre dışı kalması gerek.
  buşekilde yanlış. triggerı bayrakile devreden çıkar sok */
   /*UNIX_TIMESTAMP(time) < UNIX_TIMESTAMP()-30 AND state=1*/
	
END//
