CREATE PROCEDURE `checkWrite`(IN `in_sel` INT, IN `in_svcid` VARCHAR(250))
BEGIN

declare v_svcid MEDIUMTEXT DEFAULT CONCAT('MODBUS_',in_svcid);

	SELECT t.devId as did, t.tagName as tname, t.tagValue as val   FROM dbdixicore._tagyaz t
	INNER JOIN dbdevices._devices d ON t.devId=d.devid
	WHERE  d.svid=v_svcid;
	
	DELETE t.* FROM dbdixicore._tagyaz t
	INNER JOIN dbdevices._devices d ON t.devId=d.devid
	WHERE  d.svid=v_svcid;
