-- Dumping structure for procedure dbmymodbus.getDeviceList
DROP PROCEDURE IF EXISTS `getDeviceList`;
DELIMITER //
CREATE PROCEDURE `getDeviceList`(
	IN `in_sel` INT,
	IN `in_svcid` VARCHAR(250),
	IN `in_did` INT
)
BEGIN
declare v_svcid MEDIUMTEXT DEFAULT CONCAT('MODBUS_',in_svcid);

DECLARE CONTINUE HANDLER FOR SQLEXCEPTION BEGIN 
	GET DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
	@errno = MYSQL_ERRNO, @text = MESSAGE_TEXT;
END;

IF in_sel=0 THEN /* aktif olanları*/

	/*device listesine kaynak belirtme*/
	Select md.id,v_svcid,'MODBUS' FROM devices md 
	WHERE   md.state>10  AND md.svcid=in_svcid
	ORDER BY id;

	/*iplerini sisteme güncelleme*/
	Select md.id,'hatIp', CONCAT(md.host,':',md.port) FROM devices md 
	WHERE   md.state>10  AND md.svcid=in_svcid
	ORDER BY id;

/* servisin alacağı sonuç*/
	Select md.* FROM devices md 
	WHERE   md.state>10 AND md.svcid=in_svcid
	ORDER BY id;

	
ELSEIF in_sel=1 THEN /* tek device */

	Select md.id,v_svcid,'MODBUS' FROM devices md 
   WHERE md.state>10 AND md.id=in_did AND md.svcid=in_svcid ; 

	Select md.id,'hatIp', CONCAT(md.host,':',md.port) FROM devices md 
	WHERE md.state>10 AND md.id=in_did  AND md.svcid=in_svcid; 
	
	Select md.* FROM devices md
	WHERE md.state>10 AND md.id=in_did  AND md.svcid=in_svcid; 

END IF;
/*must be each row
 `id`, `name`, `ip`, `port`
 */
END//
DELIMITER ;

-- Dumping structure for procedure dbmymodbus.getTags
DROP PROCEDURE IF EXISTS `getTags`;
DELIMITER //
CREATE PROCEDURE `getTags`(
	IN `in_sel` INT,
	IN `in_did` VARCHAR(50)
)
BEGIN
SELECT t.did,  t.name,t.addr,t.factor,t.dataType,t.scanRate,IF(LENGTH(t.func)<3,tg.func,t.func)as func,t.state  FROM (
    (
        SELECT tg.did, tg.name,tg.addr,tg.factor,tg.dataType,tg.scanRate,tg.func,tg.state FROM devices_tags tg
        WHERE did=in_did    AND tg.state>0

    )UNION ALL(

        SELECT in_did as did, pt.name,pt.addr,pt.factor,pt.dataType,pt.scanRate,pt.func,pt.state FROM pool_tags pt
        INNER JOIN devices d ON d.id=in_did AND d.pool_id=pt.did
        WHERE pt.state>0

    )UNION ALL(

        SELECT in_did as did, pt2.name,pt2.addr,pt2.factor,pt2.dataType,pt2.scanRate,pt2.func,pt2.state FROM pool_tags pt2
       INNER JOIN devices d ON d.id=in_did
        INNER JOIN pool_types pty ON pty.id=d.pool_id  AND pt2.did=pty.refPool
        WHERE pt2.state>0

    )
) t
LEFT JOIN tag_globals tg ON tg.name=t.name -- sadece func için
GROUP BY t.name;


/*must bee each row
did, name, addr, scanRate, factor, dataType*/
END//
DELIMITER ;

